import React from "react";

function Expenses({ title, date, amount, ExpenseItem }) {
  return (
    <div className="expenses">
      {expenses.map((index) => {
        return (
          <div key={index}>
            <ExpenseItem
              title={title}
              amount={amount}
              date={date}
            />
          </div>
        );
      })}
    </div>
  );
}

export default Expenses;
